	first_name varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	last_name varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	age int NULL,
	email varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	country varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	postal_code varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	favorite_color varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	hire_date varchar(50) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	salary real NULL
